import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-homepage',
  templateUrl: './homepage.component.html',
  styleUrls: ['./homepage.component.css']
})
export class HomepageComponent implements OnInit {

  showListofServices: boolean = false;
  servicesList =
    [
      {
        "IsChecked": false,
        "ImageName": "data:image/jpeg;base64,",
        "ServiceName": "Car Wash",
        "Price": 0
      },
      {
        "IsChecked": false,
        "ImageName": "data:image/jpeg;base64,",
        "ServiceName": "Car Repair",
        "Price": 0
      },
      {
        "IsChecked": false,
        "ImageName": "data:image/jpeg;base64,",
        "ServiceName": "Car Servicing",
        "Price": 0
      },
      {
        "IsChecked": false,
        "ImageName": "data:image/jpeg;base64,",
        "ServiceName": "Car Maintenance & Inspections",
        "Price": 0
      },
      {
        "IsChecked": false,
        "ImageName": "data:image/jpeg;base64,",
        "ServiceName": "Engine and Transmission Repair",
        "Price": 0
      },
      {
        "IsChecked": false,
        "ImageName": "data:image/jpeg;base64,",
        "ServiceName": "Cooling System Repairs",
        "Price": 0
      }
    ]

  priceList = [500, 400, 500, 800, 1000, 500];
  saveSelectedService = [];
  AlertMessage: string;
  FailureMessage: boolean;
  setAllValues = [];


  constructor(private router: Router) {

  }

  ngOnInit(): void {
    for (var i in this.servicesList) {
      this.servicesList[i].Price = this.priceList[i];
    }
    if (sessionStorage.getItem("ShowListOfServices")) {
      this.showListofServices = true;
    }
    if (sessionStorage.getItem("SetAllValues")) {
      this.setAllValues = JSON.parse(sessionStorage.getItem("SetAllValues"));
      this.servicesList = this.setAllValues;
    }

  }

  // method to show block containing list of services

  selectServices() {
    this.showListofServices = true;
    sessionStorage.setItem("ShowListOfServices", JSON.stringify(this.showListofServices))
  }

  // method to select services from the list

  selectCard(event, index) {
    if (event.target.checked) {
      this.servicesList[index].IsChecked = event.target.checked;
      sessionStorage.setItem("SetAllValues", JSON.stringify(this.servicesList));
    }
    else {
      this.servicesList[index].IsChecked = false;
      sessionStorage.setItem("SetAllValues", JSON.stringify(this.servicesList));
    }
  }

  // method to save any selected service

  saveSelectedServices() {
    this.servicesList.forEach(element => {
      if (element.IsChecked == true) {
        this.saveSelectedService.push(element);
      }
      sessionStorage.setItem("SaveSelectedServices", JSON.stringify(this.saveSelectedService));
    })
    if (this.saveSelectedService.length == 0) {
      this.AlertMessage = "Please choose services to proceed further."
      this.FailureMessage = true;
      window.scroll(0, -300);
      setTimeout(() => {
        this.FailureMessage = false;
      }, 5000);
    }
    else {
      var modal = document.getElementById('confirmServiceSelection');
      modal.style.display = "block";
    }
  }

  // method to close failure toaster message

  failureClose() {
    this.FailureMessage = false;
  }

  // method to close modal 

  closePopUp() {
    var modal = document.getElementById('confirmServiceSelection');
    modal.style.display = "none";
    this.router.navigate(["/carsize"]);
  }

}
